import React, { useEffect, useState } from "react";

function HistoryPage() {
  const [history, setHistory] = useState([]);

  useEffect(() => {
    const saved = JSON.parse(localStorage.getItem("predictionHistory")) || [];
    setHistory(saved);
  }, []);

  return (
    <div style={styles.page}>
      <div style={styles.glassCard}>
        <h2 style={styles.heading}>ðŸ“Š Prediction History</h2>

        {history.length === 0 ? (
          <div style={styles.noDataBox}>
            ðŸŒ± No predictions yet! <br /> Go to the Predict Yield page and submit a form.
          </div>
        ) : (
          <div style={styles.tableWrapper}>
            <table style={styles.table}>
              <thead>
                <tr style={styles.thead}>
                  <th>Crop</th>
                  <th>Soil pH</th>
                  <th>Rainfall (mm)</th>
                  <th>Temperature (Â°C)</th>
                  <th>Predicted Yield (tons/ha)</th>
                </tr>
              </thead>
              <tbody>
                {history.map((item, index) => (
                  <tr
                    key={index}
                    style={index % 2 === 0 ? styles.rowEven : styles.rowOdd}
                    className="table-row"
                  >
                    <td>{item.Crop}</td>
                    <td>{item.Soil_pH}</td>
                    <td>{item.Rainfall}</td>
                    <td>{item.Avg_Temperature}</td>
                    <td>{item.predicted_yield}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
}

const styles = {
  page: {
    minHeight: "100vh",
    padding: "50px 20px",
    display: "flex",
    justifyContent: "center",
    alignItems: "flex-start",
    background: `linear-gradient(135deg, #e8f5e9, #ffffff)`,
    fontFamily: "'Poppins', sans-serif",
  },

  glassCard: {
    background: "rgba(255, 255, 255, 0.5)", // more transparent
    padding: "30px",
    borderRadius: "25px",
    width: "100%",
    maxWidth: "950px",
    boxShadow: "0 15px 35px rgba(0,0,0,0.15)",
    backdropFilter: "blur(15px)",
    transition: "transform 0.3s ease, box-shadow 0.3s ease",
    animation: "fadeIn 1s ease",
  },

  heading: {
    textAlign: "center",
    color: "#2E7D32",
    fontSize: "30px",
    marginBottom: "30px",
    fontWeight: "700",
  },

  noDataBox: {
    textAlign: "center",
    color: "#1B5E20",
    fontSize: "18px",
    padding: "30px",
    borderRadius: "15px",
    background: "rgba(200, 230, 201, 0.3)",
    fontWeight: "600",
    boxShadow: "0 5px 15px rgba(0,0,0,0.05)",
  },

  tableWrapper: {
    overflowX: "auto",
    borderRadius: "15px",
  },

  table: {
    width: "100%",
    borderCollapse: "separate",
    borderSpacing: "0 5px",
    textAlign: "center",
    fontSize: "15px",
  },

  thead: {
    background: "rgba(76, 175, 80, 0.3)",
    fontWeight: "600",
    color: "#1B5E20",
    textTransform: "uppercase",
  },

  rowEven: {
    background: "rgba(255, 255, 255, 0.6)",
    transition: "all 0.3s ease",
    borderRadius: "10px",
  },

  rowOdd: {
    background: "rgba(230, 255, 230, 0.6)",
    transition: "all 0.3s ease",
    borderRadius: "10px",
  },
};

// Add hover effect using CSS
const css = `
.table-row:hover {
  transform: scale(1.02);
  box-shadow: 0 6px 20px rgba(76,175,80,0.3);
  cursor: pointer;
}
@keyframes fadeIn {
  from { opacity: 0; transform: translateY(20px);}
  to { opacity: 1; transform: translateY(0);}
}
`;
if (typeof document !== "undefined") {
  const style = document.createElement("style");
  style.innerHTML = css;
  document.head.appendChild(style);
}

export default HistoryPage;
